    "description": "The first sanctioned new school flow trail, was rebuilt by the District of North Vancouver Trail crew in 2010. The proof is in the pudding of its popularity.  On a nice day, you literally need to take a number for the flow show: big berms, small doubles and buff, undulating trail will have you climbing back up for another lap.  Barely 10 minutes up [L=http://www.trailforks.com/trails/mountain-highway/]Mountain Highway[/L], it is easily accessed.  It's importance lies not only in its popularity, but it proves new school trails can be built on the Shore.\r\n\r\nEntirely pumped and some good carved berms. Has a wood wall ride, that must be ridden cautiously when wet. Wooden gaps can be jumped, but you bypass them as well. If you carry enough speed on this track you can jump from one pump to another, and that is very fun. Suitable for beginners and expert riders.",
    "access_info": "Accessed before the 2nd switchback, exits above the [L=http://www.trailforks.com/trails/baden-powell/]Baden Powell[/L].",
