    "skidmap_id": "0",
    "description": "Seventh Secret is one of the north shore classic mountain bike trails. It's an all weather, heavily armoured bike trail flowing from just before the seventh switch-back on mountain hwy back to the sixth switch back between [L=http://www.trailforks.com/trails/pipeline/]Pipeline[/L] and [L=http://www.trailforks.com/trails/expresso/]Expresso[/L]. The few ladders, bridges, jumps and log rides are easier than you might at first expect, but sometimes come at you by surprise, so you may want to go easy on your first descent. The more difficult stuff mostly has easier work arounds.\r\n\r\nThis trail is probably one of the most enjoyable mixed rides on the north shore, and a must do for intermediate riders. It connects up with [L=http://www.trailforks.com/trails/crinkum-crankum/]Crinkum Crankum[/L] (via [L=http://www.trailforks.com/trails/leppard/]Leppard[/L]/[L=http://www.trailforks.com/trails/kirkford/]Kirkford[/L]) by heading left at the boardwalk T-intersection, or can be followed on with [L=http://www.trailforks.com/trails/pipeline/]Pipeline[/L] or [L=http://www.trailforks.com/trails/expresso/]Expresso[/L] by heading right to the road. If heading towards Crinkum, you will probably not want to ride the optional long log ride at the bottom, but continue down the trail instead to the boardwalk.",
